import { useContext } from "react"
import { Link } from "react-router-dom";
import { productContext } from "../MainSection"


function ProductInfo() {
    const context = useContext(productContext)
    console.log(context);
    return (
        <div className="d-flex flex-column flex-shrink-0 p-3 text-white bg-dark myProduct" >

            <div className="nav nav-pills flex-column mb-auto">
                {context.productList.map((item, i) => {
                    return <Link to={'/gallary'}>{item}</Link>
                })}


            </div>
        </div>
    )
}
export default ProductInfo
